    false,nt"url": null,nt"notes": "This annual narrative report for Erie National
    Wildlife Refuge outlines activities and accomplishments during the 2001 calendar
    year. The report begins with an introduction to the Refuge. Highlights and weather
    conditions are summarized for the year. Information about monitoring and studies-
    including surveys and censuses and studies and investigations- is provided next.
    Habitat restoration and management projects are also covered; activities include
    water level management and farming. Fish and wildlife management are discussed next
    with emphasis on bird banding and nest structures. The resource protection section
    provides an update on law enforcement and permits. Information about public education
    and recreation is given including visitor services and outreach. Finally, general
    administration is discussed in the Refuge planning and administration section",nt"license_title":
